window.CUCUMBER_MESSAGES = [{"meta":{"protocolVersion":"24.1.0","implementation":{"version":"11.1.1","name":"cucumber-js"},"cpu":{"name":"x64"},"os":{"name":"win32","version":"10.0.22631"},"runtime":{"name":"node.js","version":"22.12.0"}}},{"source":{"data":"@a1\r\nFeature: Shopping for Cars and Selecting the Available Car Model\r\n \r\n Background:\r\n   Given I launch the URL and land on the homepage\r\n     And I accept cookies from the homepage\r\n     And I click on \"Shopping tools\" from the homepage\r\n     And I select the \"Available cars\" option.\r\n\r\n Scenario Outline: Verify 'Sort By' filters functiionality\r\n     When I enter zip code and select an address from the suggestions\r\n      And I should continue with the selected Retailer address\r\n     Then I verify the default sort \"Quickest delivery\" filter applied\r\n      And I Apply Price \"<SortFilter>\" Filter the the Cars Dispaly should be \"<DisplayOrder>\" Sorted order \r\n   Examples:\r\n      | SortFilter      | DisplayOrder  |\r\n      | High to low     | descending    |\r\n      | Low to high     | ascending     |\r\n\r\n Scenario Outline: Verify Car Filters with Various Combinations of Selections\r\n     When I enter zip code and select an address from the suggestions\r\n      And I should continue with the selected Retailer address\r\n     When I apply the following filters from car selection page : \r\n       | Exterior    | Version    | Packs      | Options    | Interior    | Wheels     |\r\n       | <Exterior>  | <Version>  | <Packs>    | <Options>  | <Interior>  | <Wheels>   |\r\n     And  I Click on the results button  \r\n    Then I should see cars that match the selected filters:\r\n       | Exterior    | Version    | Packs      | Options    | Interior    | Wheels     |\r\n       | <Exterior>  | <Version>  | <Packs>    | <Options>  | <Interior>  | <Wheels>   |\r\n    Examples:\r\n    # Case 1: Select all options for exterior, version, packs, options, interior, and wheels\r\n       | Exterior  | Version               | Packs       | Options                     | Interior                | Wheels           |\r\n       | Snow      | Long range Dual motor | Performance | Harman Kardon premium sound | Charcoal Nappa leather  | 20\" Performance  |\r\n       | Space     | Long range Dual motor | Climate     | Harman Kardon premium sound | Zinc Nappa leather      | 20\" Performance  |\r\n       | Storm     | Long range Dual motor | Performance | Harman Kardon premium sound | Charcoal WeaveTech      | 20\" Performance  |\r\n    # Case 2: Select only a few options from each category (some are left blank or not selected)\r\n       |           | Long range Dual motor | Performance | Harman Kardon premium sound | Charcoal Nappa leather  | 20\" Performance  |\r\n       | Space     |                       |             | Harman Kardon premium sound | Zinc Nappa leather      | 20\" Performance  |\r\n       | Midnight  | Long range Dual motor | Climate     |                             | Slate WeaveTech         | 20\" Performance  |\r\n    # Case 3: Select some options from only specific categories (more selective filtering)\r\n       | Snow      |                       | Performance |                             | Charcoal Nappa leather  | 20\" Performance  |\r\n       | Vapour    |                       | Pilot       | Harman Kardon premium sound | Zinc Nappa leather      |                  |\r\n    # Case 4: Test all versions with specific interior and wheels combination\r\n       | Snow      | Long range Dual motor | Performance |                              | Charcoal Nappa leather | 20\" Performance |\r\n       | Midnight  | Long range Dual motor | Performance |                              | Slate WeaveTech        | 20\" Performance |\r\n       | Storm     | Long range Dual motor | Pilot       |                              | Charcoal Nappa leather | 20\" Performance |\r\n\r\n    Scenario: Verify Default Filters for Car Details by Pin Code and Address\r\n     When I enter zip code and select an address from the suggestions\r\n     Then I should continue with the selected Retailer address\r\n      And I verify the default \"Polestar 2\" car model displayed in filter\r\n      And I see car Modelyear, Powertrain and prices in dollars\r\n\r\n    Scenario: Viewing More Car Options with Details by clicking show more\r\n     When I enter zip code and select an address from the suggestions\r\n      And I should continue with the selected Retailer address\r\n      And I click on the \"Show more\" button\r\n     Then I should see more car options with Modelyear, Powertrain and price details\r\n \r\n\r\n  # # Scenario for resetting filters dynamically based on a user's action\r\n  # Scenario: Reset filters dynamically\r\n  #   Given I am on the car selection page\r\n  #   When I select \"Clear All Filter\r\n  #   Then I should see all the cars available without any filters applied","uri":"tests\\features\\AvailableCarsSelection.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[{"location":{"line":1,"column":1},"name":"@a1","id":"bc062472-aa04-4d43-807c-97d1edc54295"}],"location":{"line":2,"column":1},"language":"en","keyword":"Feature","name":"Shopping for Cars and Selecting the Available Car Model","description":"","children":[{"background":{"id":"05cc0813-1422-4018-9fc0-de3485d14d4d","location":{"line":4,"column":2},"keyword":"Background","name":"","description":"","steps":[{"id":"fd5d4afe-4e95-491f-be44-8f6d9175e89f","location":{"line":5,"column":4},"keyword":"Given ","keywordType":"Context","text":"I launch the URL and land on the homepage"},{"id":"878459b7-ce0c-405b-bcb0-a32479466a3d","location":{"line":6,"column":6},"keyword":"And ","keywordType":"Conjunction","text":"I accept cookies from the homepage"},{"id":"d713b7f6-e482-4d65-93e6-b73ce6face94","location":{"line":7,"column":6},"keyword":"And ","keywordType":"Conjunction","text":"I click on \"Shopping tools\" from t kies and click on the View Offers button\r\n    And I navigate to the Pre-Owned Vehicle Offers section and Clicked on Filter button\r\n  \r\n  Scenario Outline: Verify filters for Polestar Pre-owned <Car> (<ModelYear> Model) with <Powertrain> options.\r\n    When I click on the \"Car\" filter and select the checkbox option for \"<Car>\"\r\n    And  I click on the \"Model year\" filter and select the checkbox option for \"<ModelYear>\"\r\n    And  I click on the \"Powertrain\" filter and select the checkbox option for \"<Powertrain>\"\r\n    And  I click the \"View\" button.\r\n    Then the results should match the filter criteria \"<ExpectedResult>\".\r\n\r\n    Examples:\r\n      | Car         | ModelYear | Powertrain      | ExpectedResult                       |\r\n      | Polestar 2  | 2024      | All             | Polestar 2 Certified Pre-owned       |\r\n      | Polestar 2  | 2023      | All             | Polestar 2 Certified Pre-owned       |\r\n      | Polestar 2  | 2022      | All             | Polestar 2 Certified Pre-owned       |\r\n      | Polestar 2  | 2021      | All             | Polestar 2 Certified Pre-owned       |\r\n   ","uri":"tests\\features\\FiltersPre-OwnedVehicleOffers.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[{"location":{"line":1,"column":1},"name":"@web","id":"ee1ff3d6-15f0-411a-b1e1-d1923c29d70f"}],"location":{"line":2,"column":1},"language":"en","keyword":"Feature","name":"Verify Filter Functionality for Polestar Offers","description":"  As a user of the Polestar website\n  I want to apply filters to Pre Owned vehicle offers\n  So that I can verify the filter functionality works correctly and display accurate results","children":[{"background":{"id":"493abfb6-b168-4e65-a8ce-771bad93c0fb","location":{"line":7,"column":3},"keyword":"Background","name":"","description":"","steps":[{"id":"86fc3fc9-8219-475b-af50-66cd753c973a","location":{"line":8,"column":5},"keyword":"Given ","keywordTyp a8-cf92-48c8-a0c0-b4d589998203"]}],"tags":[{"name":"@web","astNodeId":"ee1ff3d6-15f0-411a-b1e1-d1923c29d70f"}]}},{"source":{"data":"@api\r\nFeature: GoRest User Management APIs\r\n  As a tester, I want to validate the core operations of the Gorest user Management APIs\r\n  so that I can ensure it functions correctly for listing, creating, updating, and deleting users.\r\n\r\n  Background:\r\n    Given The API is initialized with the base URL\r\n    And   Authentication is performed with a valid access token\r\n\r\n  Scenario: Retrive the List of users via using \"List Users\" API\r\n    When  A Get Request is made to retrieve the list of users\r\n    Then  The system should respond with a 200 OK status\r\n    And   The response should contain a list of users\r\n\r\n  Scenario: Create a new user By Using the \"Create User\" API\r\n    Given The user details are:\r\n      | Name               | Gender | Email                        | Status |\r\n      | Tenali Ramakrishna | Male   | tenali.ramakrishna@abdce.com | Active |\r\n    When  A Post request is made to create a new user\r\n    Then  The system should respond with a 201 Created status\r\n    And   The response should include the following:\r\n      | Name               | Status |\r\n      | Tenali Ramakrishna | Active |\r\n    And   The user ID should be saved for future use\r\n    And   I save the user ID for later\r\n\r\n  Scenario: Update the user details By Using the \"Update User\" API\r\n   Given The user details for update are\r\n      | Name              | Email                           | Status |\r\n      | Allasani Peddana  | allasani.peddana@1234.com | active |\r\n    When A Patch request is made to update the user with the saved ID\r\n    Then The system should respond with 200 OK status\r\n    And  The response should include the following details:\r\n      | Name             | Email                           | Status |\r\n      | Allasani Peddana | allasani.peddana@1234.com | active |\r\n    And  The user ID should remain the same\r\n    And  The updated user details should be reflected\r\n\r\n\r\n  Scenario Outline: Delete the user via \"Delete User\" API\r\n     When  A Delete request is made to delete the user with the saved ID\r\n     Then  The system should respond with a 204 No Content status\r\n     And   The user should no longer exist in the system\r\n","uri":"tests\\features\\GoRestApi.feature","mediaType":"text\/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"feature":{"tags":[{"location":{"line":1,"column":1},"name":"@api","id":"746bb96c-101f-4e12-920e-2dc8916e9f95"}],"location":{"line":2,"column":1},"language":"en","keyword":"Feature","name":"GoRest User Management APIs","description":"  As a tester, I want to validate the core operations of the Gorest user Management APIs\n  so that I can ensure it functions correctly for listing, creating, updating, and deleting users.","children":[{"background":{"id":"637bc3eb-7c59-413e-8ee9-ae9dea595b8c","location":{"line":6,"column":3},"keyword":"Background","name":"","description":"","steps":[{"id":"6bc9b481-3ce6-48e0-b212-1a08033fa278","location":{"line":7,"column":5},"keyword":"Given ","keywordType":"Context","text":"The API is initialized with the base URL"},{"id":"3a74f492-c4d6-40b9-b4f4-5589caad60e2","location":{"line":8,"column":5},"keyword":"And ","keywordType":"Conjunction","text":"Authentication is performed with a valid access token"}]}},{"scenario":{"id":"72d329a8-3556-4ee5-b349-2d1706ce9e35","tags":[],"location":{"line":10,"column":3},"keyword":"Scenario","name":"Retrive the List of users via using \"List Users\" API","description":"","steps":[{"id":"40474ae2-b40f-4137-8e95-23915d6b5c03","location":{"line":11,"column":5},"keyword":"When ","keywordType":"Action","text":"A Get Request is made to retrieve the list of users"},{"id":"dca7e10b-b867-41fc-8a1b-47a87b6d0dc3","location":{"line":12,"column":5},"keyword":"Then ","keywordType":"Outcome","text":"The system should respond with a 200 OK stat
